module.exports =async d => {
    const code = d.command.code 
    
    const r = code.split("$findNumbers").length - 1 
    
    const inside = code.split("$findNumbers[")[r].split("]")[0] 
    
    return {
        code: code.replaceLast(`$findNumbers[${inside}]`, inside.replace(/[^0-9]/g, ""))
    }
}